#
# TABLE STRUCTURE FOR: Customers
#

DROP TABLE IF EXISTS `Customers`;

CREATE TABLE `Customers` (
  `phone_bigint` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `middle_initial` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `login_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `town_city` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `login_password` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `country` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `first_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `organisation_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email_address` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customer_id` bigint(20) NOT NULL,
  PRIMARY KEY (`customer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


#
# TABLE STRUCTURE FOR: Products
#

DROP TABLE IF EXISTS `Products`;

CREATE TABLE `Products` (
  `product_price` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `other_product_details` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `return_merchandise_authorization_nr` bigint(20) DEFAULT NULL,
  `product_id` bigint(20) NOT NULL,
  `product_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `product_color` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `product_size` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `product_description` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


#
# TABLE STRUCTURE FOR: Customer_Payment_Methods
#

DROP TABLE IF EXISTS `Customer_Payment_Methods`;

CREATE TABLE `Customer_Payment_Methods` (
  `customer_payment_id` bigint(20) NOT NULL,
  `payment_method_details` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `credit_card_bigint` bigint(20) DEFAULT NULL,
  `payment_method_description` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customer_id4` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`customer_payment_id`),
  KEY `customer_id4_FK` (`customer_id4`),
  CONSTRAINT `customer_id4_FK` FOREIGN KEY (`customer_id4`) REFERENCES `Customers` (`customer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


#
# TABLE STRUCTURE FOR: Orders
#

DROP TABLE IF EXISTS `Orders`;

CREATE TABLE `Orders` (
  `order_id` bigint(20) NOT NULL,
  `order_details` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date_order_placed` date DEFAULT NULL,
  `order_status_description` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customer_id3` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  KEY `customer_id3_FK` (`customer_id3`),
  CONSTRAINT `customer_id3_FK` FOREIGN KEY (`customer_id3`) REFERENCES `Customers` (`customer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: Invoices
#

DROP TABLE IF EXISTS `Invoices`;

CREATE TABLE `Invoices` (
  `invoice_bigint` bigint(20) NOT NULL,
  `invoice_date` date DEFAULT NULL,
  `invoice_details` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `invoice_status_description` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `order_id4` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`invoice_bigint`),
  KEY `order_id4_FK` (`order_id4`),
  CONSTRAINT `order_id4_FK` FOREIGN KEY (`order_id4`) REFERENCES `Orders` (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: Shipments
#

DROP TABLE IF EXISTS `Shipments`;

CREATE TABLE `Shipments` (
  `shipment_id` bigint(20) NOT NULL,
  `shipment_date` date DEFAULT NULL,
  `other_shipment_details` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `shipment_tracking_bigint` bigint(20) DEFAULT NULL,
  `order_id5` bigint(20) DEFAULT NULL,
  `invoice_bigint5` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`shipment_id`),
  KEY `order_id5_FK` (`order_id5`),
  KEY `invoice_bigint5_FK` (`invoice_bigint5`),
  CONSTRAINT `invoice_bigint5_FK` FOREIGN KEY (`invoice_bigint5`) REFERENCES `Invoices` (`invoice_bigint`),
  CONSTRAINT `order_id5_FK` FOREIGN KEY (`order_id5`) REFERENCES `Orders` (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: Payments
#

DROP TABLE IF EXISTS `Payments`;

CREATE TABLE `Payments` (
  `payment_id` bigint(20) NOT NULL,
  `payment_amount` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `payment_date` date DEFAULT NULL,
  `invoice_bigint3` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`payment_id`),
  KEY `invoice_bigint3_FK` (`invoice_bigint3`),
  CONSTRAINT `invoice_bigint3_FK` FOREIGN KEY (`invoice_bigint3`) REFERENCES `Invoices` (`invoice_bigint`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




#
# TABLE STRUCTURE FOR: Order_items
#

DROP TABLE IF EXISTS `Order_items`;

CREATE TABLE `Order_items` (
  `order_item_id` bigint(20) NOT NULL,
  `order_item_quantity` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `order_item_price` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `RMA_bigint` bigint(20) DEFAULT NULL,
  `RMA_issued_by` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `other_order_item_details` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `order_item_status_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `RMA_issued_date` date DEFAULT NULL,
  `order_id8` bigint(20) DEFAULT NULL,
  `product_id9` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`order_item_id`),
  KEY `order_id8_FK` (`order_id8`),
  KEY `product_id9_FK` (`product_id9`),
  CONSTRAINT `order_id8_FK` FOREIGN KEY (`order_id8`) REFERENCES `Orders` (`order_id`),
  CONSTRAINT `product_id9_FK` FOREIGN KEY (`product_id9`) REFERENCES `Products` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: shipment_items
#

DROP TABLE IF EXISTS `shipment_items`;

CREATE TABLE `shipment_items` (
  `shipment_id0` bigint(20) NOT NULL,
  `order_item_id1` bigint(20) NOT NULL,
  PRIMARY KEY (`shipment_id0`,`order_item_id1`),
  KEY `order_item_id1_FK` (`order_item_id1`),
  CONSTRAINT `order_item_id1_FK` FOREIGN KEY (`order_item_id1`) REFERENCES `Order_items` (`order_item_id`),
  CONSTRAINT `shipment_id0_FK` FOREIGN KEY (`shipment_id0`) REFERENCES `Shipments` (`shipment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;








































